import React, { useEffect , useState} from 'react';
import io from 'socket.io-client';

const socket = io('http://localhost:5002'); // Replace with your server address

function Test() {

  const [onclick, setOnclick] = use

  useEffect(() => {
    socket.on('connect', () => {
      console.log('Connected to server');
    });

    socket.on('disconnect', () => {
      console.log('Disconnected from server');
    });

    socket.on('data', (data) => {
      console.log('Received data from Kafka:', data);
      // Handle incoming data here
    });

    return () => {
      socket.disconnect();
    };
  }, []);

  return <div className='m-64'>React Test</div>;
}

export default Test;
